import React from 'react'
import "./Membership.css"
import { Hero } from '../Hero';

function Membership() {
  return (
    <Hero MainTextOut="Membership" MainTextSize="110px" MainTextMarginTop="65px" SubTextMarginTop="180px" MainTextOth="Plans" SubText="Choose a plan that works best for you"/>
  )
}

export default Membership;
